import React, { Component } from "react";

export class home extends Component {
  state = {};

  render() {
    return (
      <section class="hero is-info is-large">

        <div class="hero-body">
          <div class="container has-text-centered">
            <p class="title">
              <h1>WELCOME TO </h1>
            </p>
            <br/>
            <p class="subtitle">
              <h4>NOW U CAN ORDER COFFE ON LINE</h4>
            </p>
          </div>
        </div>
      </section>
    );
  }
}

export default home;
